import { Box, Text } from '@chakra-ui/react';
import React from 'react';

interface Props {
  windInfo: {
    location: string;
    wind_speed: string;
    wind_direction: string;
    // Add other wind-related information as needed
  };
}

const WindInfo: React.FC<Props> = ({ windInfo }) => {
  return (
    <Box mt={4}>
      <Text>
        Location: {windInfo.location}
      </Text>
      <Text>
        Wind Speed: {windInfo.wind_speed}
      </Text>
      <Text>
        Wind Direction: {windInfo.wind_direction}
      </Text>
      {/* Add other wind-related information as needed */}
    </Box>
  );
};

export default WindInfo;
